import org.apache.commons.lang.RandomStringUtils

charset = (('a'..'z')).join()
def String userName = RandomStringUtils.random(10,charset.toCharArray())
def String firstName = RandomStringUtils.random(10,charset.toCharArray())
def String secondName = RandomStringUtils.random(10,charset.toCharArray())
def String mail = RandomStringUtils.random(10,charset.toCharArray()) + "@dhm-it.com"

testRunner.testCase.setPropertyValue("userName",'"' + userName + '"')
testRunner.testCase.setPropertyValue("firstName",'"' + firstName + '"')
testRunner.testCase.setPropertyValue("secondName",'"' + secondName + '"')
testRunner.testCase.setPropertyValue("mail",'"' + mail + '"')
